import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="content">
        <div>{'Gloves'}</div>
        <div>{'Beanies'}</div>
        <div>{'Face masks'}</div>
      </div>
    </div>
  );
}

export default App;
